import React from 'react'
import '../styles/Product.css';

const Product = () => {
    return (
        <div className='product'>
            <h1 className='product-title'>Bocallave 13mm</h1>
            <p className='product-p'>Dafys</p>
            <p className="product-price">Precio contado: $2500</p>
        </div>
    )
}

export default Product;
